// version
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";


contract TokyoTower is ERC721Enumerable, Ownable {
  using Strings for uint256;

  uint256 randNonce = 0;

  mapping(uint256 => uint256) private _metadata;

  constructor() ERC721("TokyoTowerNFT", "TTNFT") {}

  function mint(address to) public virtual {
    require(balanceOf(msg.sender) == 0, "one for each.");
    require(totalSupply() < 100, "All NFT are already minted.") ;

    // tokneIDmetadataID
    uint256 tokenId = totalSupply() + 1;
    uint256 metadataId = this.rand(100);
    randNonce ++;

    //metadataIdtokenId
    _metadata[tokenId] = metadataId;

    _mint(to, tokenId);
  }

  function tokenURI(uint256 tokenId) public view virtual override returns (string memory) {
    return string(abi.encodePacked("https://gateway.pinata.cloud/ipfs/QmQy1Yp2NJiY5Mbyaa5zvk53Kbo1jvYfiVSJf3N46GJc6w/", _metadata[tokenId].toString(), ".json"));
  }

  function rand(uint256 mod) external view returns (uint256 result) {

    // metadataIDreturn
    while(true){
      uint _number = uint256(keccak256(abi.encodePacked(block.timestamp, msg.sender, randNonce))) % mod + 1;
      if (_metadata[_number] == 0) {
        return _number;
      } else {
        continue;
      }
    } 
  }

}
